import React, {
  Component
} from 'react'
import './Add.less';
class StepOne extends Component {
  render() {
    return ( <
      div className = "stepOne" >
      <
      ul >
      <
      li > < /li> <
      /ul> <
      /div>
    )
  }
}

class StepTwo extends Component {
  render() {
    return ( <
      div className = "stepTwo" >
      11111111111111111 <
      /div>
    )
  }
}
class StepThree extends Component {
  render() {
    return ( <
      div className = "stepThree" >
      22222222222222 <
      /div>
    )
  }
}
export {
  StepOne,
  StepTwo,
  StepThree
}
